-- Adição das imagens das regiões no banco de dados
UPDATE `regioes` SET `img_regiao` =  where `regioes`.`id_regiao`= 1;
UPDATE `regioes` SET `img_regiao` =  where `regioes`.`id_regiao`= 2;
UPDATE `regioes` SET `img_regiao` =  where `regioes`.`id_regiao`= 3;
UPDATE `regioes` SET `img_regiao` =  where `regioes`.`id_regiao`= 4;
UPDATE `regioes` SET `img_regiao` =  where `regioes`.`id_regiao`= 5;

-- Adição das imagens dos biomas no banco de dados
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 1;
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 2;
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 3;
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 4;
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 5;
UPDATE `biomas` SET `img_bioma` =  WHERE `biomas`.`id_bioma` = 6;

